    <g aria-label="O motor Wankel consiste essencialmente em uma câmara cujo formato interno se aproxima da forma de um oito. Dentro dela, um rotor mais ou menos triangular gira excentricamente em relação ao eixo principal, que equivale à cambota dos motores a pistões. As formas destes dois elementos são tais que enquanto os cantos do pistão estão sempre equidistantes das paredes da câmara - e muito próximos delas, formando uma vedação - eles sucessivamente aumentam e diminuem o espaço entre os lados convexos do triângulo - o rotor - e as paredes da câmara.  Assim, se uma mistura for injetada numa das câmaras, quando está a aumentar de tamanho, será comprimida na redução subsequente de volume, enquanto o rotor, ou pistão, gira. Deste modo, o ciclo clássico de quatro tempos - admissão, compressão, explosão e exaustão - é produzido e, além disso, as três faces do rotor estão em três fases diferentes do ciclo, ao mesmo tempo. " transform="matrix(0.45925585,0,0,0.45925585,-9543.0592,-3294.5667)" id="text27528" style="font-size:192px;line-height:1.25;font-family:sans-serif;white-space:pre;shape-inside:url(#rect27530-0);display:inline;fill:#516da6;fill-opacity:1">

    <g aria-label="Felix Wankel concebeu seu motor rotativo por volta de 1924 e obteve sua primeira patente em 1933. Durante a década de 1940, dedicou-se a melhorar o seu projeto. Ainda nas décadas de 1950 e 1960, houve um esforço considerável no desenvolvimento de motores rotativos Eram particularmente interessantes por funcionar de um modo suave e silencioso, devido à simplicidade de seu mecanismo, e também pelo número reduzido de peças, comparado com os motores alternativos a pistão. " transform="matrix(0.45925585,0,0,0.45925585,-9380.2259,6276.2712)" id="text28540" style="font-size:192px;line-height:1.25;font-family:sans-serif;white-space:pre;shape-inside:url(#rect28542-2);display:inline;fill:#516da6;fill-opacity:1">

    <g aria-label="As vantagens do motor Wankel sobre os motores de pistão convencional são muitas. Em primeiro lugar, não existem vibrações devido ao fato de só haver um movimento rotativo, isso significa ainda menor desgaste e vida mais longa. O motor Wankel não tem nada de complicado, pelo contrário, tem poucos componentes e é bem menor. Além disso gera mais potência e mais binário que um motor &quot;convencional&quot; de mesma cilindrada. Isto porque cada lado do seu rotor encontra-se numa fase do ciclo, gerando mais explosões por volta do eixo da cambota do que um motor de pistão. " transform="matrix(0.45925585,0,0,0.45925585,464.17326,-2074.6254)" id="text33764" style="font-size:192px;line-height:1.25;font-family:sans-serif;white-space:pre;shape-inside:url(#rect33766);display:inline;fill:#516da6;fill-opacity:1">
